      body {
        font-family: Arial, sans-serif;
        margin: 20px;
      }
  
      h1 {
        text-align: center;
        color: #333; /* Header color */
      }
  
      .test-case {
        margin-bottom: 20px;
        border: 1px solid #ccc;
        border-radius: 5px;
        padding: 10px;
      }
  
      .test-case-title {
        font-size: 18px;
        font-weight: bold;
        margin-bottom: 10px;
        color: #007bff; /* Header color */
      }
  
      .test-case-location {
        font-size: 14px;
        color: #666;
      }
  
      .test-case-text {
        font-size: 16px;
        margin-bottom: 10px;
      }
  
      .test-case-status {
        font-size: 14px;
        font-weight: bold;
        color: green; /* Status color */
      }
  
      .test-case-timeline {
        display: flex;
        justify-content: space-between;
        font-size: 14px;
        margin-top: 10px;
      }
  
      .event {
        margin-top: 10px;
        padding: 5px;
        border-radius: 5px;
        display: flex;
        align-items: center;
        cursor: pointer;
      }
  
      .event-type {
        margin-right: 10px;
        font-weight: bold;
      }
  
      .event-message {
        font-size: 14px;
        color: #333;
      }
  
      .event-time {
        font-size: 14px;
        color: #666;
        margin-left: auto;
      }
  
      /* Different colors for events */
      .event-started {
        background-color: #ebfbee;
      }
  
      .event-running {
        background-color: #f9f2f4;
      }
  
      .event-error {
        background-color: #ffe3e3;
      }
    </style>
</head>

    const testCasesContainer = document.getElementById('test-cases');

    testData.forEach((testCase) => {
      const containerHierarchyTexts = testCase.ContainerHierarchyTexts;
      if (containerHierarchyTexts) {
        const testCaseDiv = document.createElement('div');
        testCaseDiv.classList.add('test-case');

        const testCaseTitle = document.createElement('div');
        testCaseTitle.classList.add('test-case-title');
        testCaseTitle.textContent = containerHierarchyTexts.join(' > ');

        const testCaseLocation = document.createElement('div');
        testCaseLocation.classList.add('test-case-location');
        testCaseLocation.textContent = testCase.LeafNodeLocation.FileName + ' : ' + testCase.LeafNodeLocation.LineNumber;

        const testCaseText = document.createElement('div');
        testCaseText.classList.add('test-case-text');
        testCaseText.textContent = testCase.LeafNodeText;

        const testCaseStatus = document.createElement('div');
        testCaseStatus.classList.add('test-case-status');
        testCaseStatus.textContent = `Status: ${testCase.State.toUpperCase()}`;

        const testCaseTimeline = document.createElement('div');
        testCaseTimeline.classList.add('test-case-timeline');
        testCaseTimeline.textContent = `Started at: ${testCase.StartTime}, Ended at: ${testCase.EndTime}`;

        testCaseDiv.appendChild(testCaseTitle);
        testCaseDiv.appendChild(testCaseLocation);
        testCaseDiv.appendChild(testCaseText);
        testCaseDiv.appendChild(testCaseStatus);
        testCaseDiv.appendChild(testCaseTimeline);

        const events = testCase.Events;
        if (events && events.length > 0) {
          const eventsContainer = document.createElement('div');
          eventsContainer.classList.add('events-container');

          events.forEach((event) => {
            const eventDiv = document.createElement('div');
            eventDiv.classList.add('event');
            let eventClassName = 'event';

            switch (event.SpecEventType) {
              case 'Node':
                eventClassName += '-started';
                break;
              case 'Node (End)':
                eventClassName += '-running';
                break;
              case 'Error':
                eventClassName += '-error';
                break;
            }

            eventDiv.classList.add(eventClassName);

            const eventType = document.createElement('div');
            eventType.classList.add('event-type');
            eventType.textContent = event.SpecEventType;

            const eventMessage = document.createElement('div');
            eventMessage.classList.add('event-message');
            eventMessage.textContent = event.Message;

            const eventTime = document.createElement('div');
            eventTime.classList.add('event-time');
            eventTime.textContent = event.Time;

            eventDiv.appendChild(eventType);
            eventDiv.appendChild(eventMessage);
            eventDiv.appendChild(eventTime);

            // Add click event to the event div
            eventDiv.addEventListener('click', () => {
              alert(`Clicked: ${event.Message}`);
            });

            eventsContainer.appendChild(eventDiv);
          });

          testCaseDiv.appendChild(eventsContainer);
        }

        testCasesContainer.appendChild(testCaseDiv);
      }
    });


        function filterTestCases() {
            const searchInput = document.getElementById('searchInput').value.toLowerCase();
            const testCases = document.querySelectorAll('.test-case');

            testCases.forEach((testCase) => {
                const testCaseTitle = testCase.querySelector('.test-case-title').textContent.toLowerCase();
                const testCaseText = testCase.querySelector('.test-case-text').textContent.toLowerCase();
                const testCaseStatus = testCase.querySelector('.test-case-status').textContent.toLowerCase();

                if (
                    testCaseTitle.includes(searchInput) ||
                    testCaseText.includes(searchInput) ||
                    testCaseStatus.includes(searchInput)
                ) {
                    testCase.style.display = 'block';
                } else {
                    testCase.style.display = 'none';
                }
            });
        }
